sys_hub_input_scripts.script:
{"contributors":{"scriptActive":true,"script":"/*
**Access Flow/Action data using the fd_data object. Script must return a value.
**Available options display upon pressing "." after fd_data
**example: var shortDesc = fd_data.trigger.current.short_description;
**return shortDesc;
*/
/*
**Access Flow/Action data using the fd_data object. Script must return a value.
**Available options display upon pressing "." after fd_data
**example: var shortDesc = fd_data.trigger.current.short_description;
**return shortDesc;
*/
var previous = fd_data._1__for_each.item.previous_value.toString().split(",");
var current = fd_data._1__for_each.item.current_value.toString().split(",");
return current.filter(function(currSysId) {
 return previous.indexOf(currSysId) == -1;
}).join();"}}

